define({"topics" : [{"title":"Database Vendors and Drivers","shortdesc":"\n               <p class=\"shortdesc\">The JDBC Query Consumer origin can read database data from multiple database         vendors.</p>\n            ","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_xrt_kb3_bhb","attributes": {"data-id":"concept_xrt_kb3_bhb",},"menu": {"hasChildren":true,},"tocID":"concept_xrt_kb3_bhb-d46e74592","next":"concept_xrt_kb3_bhb-d46e74592",},{"title":"Installing the JDBC Driver","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_aq1_lxp_fs","attributes": {"data-id":"concept_aq1_lxp_fs",},"menu": {"hasChildren":false,},"tocID":"concept_aq1_lxp_fs-d46e74812","topics":[]},{"title":"Offset Column and Offset Value","shortdesc":"\n               <p class=\"shortdesc\">JDBC Query Consumer <span class=\"ph\">uses an offset column and initial offset value to determine                 where to start reading data within a table. Include\n                     both the offset column and the                 offset value in the WHERE clause of the SQL query. </span></p>\n            ","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_nxz_2kz_bs","attributes": {"data-id":"concept_nxz_2kz_bs",},"menu": {"hasChildren":false,},"tocID":"concept_nxz_2kz_bs-d46e74884","topics":[]},{"title":"Full and Incremental Mode","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_ets_gnr_bs","attributes": {"data-id":"concept_ets_gnr_bs",},"menu": {"hasChildren":false,},"tocID":"concept_ets_gnr_bs-d46e74972","topics":[]},{"title":"Recovery","shortdesc":"\n               <p class=\"shortdesc\"> JDBC Query Consumer <span class=\"ph\">supports recovery after a deliberate or unexpected stop when it                 performs incremental queries. Recovery is\n                     not supported for full queries.</span></p>\n            ","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_hcm_gdq_ds","attributes": {"data-id":"concept_hcm_gdq_ds",},"menu": {"hasChildren":false,},"tocID":"concept_hcm_gdq_ds-d46e75065","topics":[]},{"title":"SQL Query","shortdesc":"\n               <p class=\"shortdesc\">The SQL query defines the data returned from the database. You define the query in         the SQL Query property on the JDBC\n                  tab. \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_uj4_mxy_bs","attributes": {"data-id":"concept_uj4_mxy_bs",},"menu": {"hasChildren":true,},"tocID":"concept_uj4_mxy_bs-d46e75173","next":"concept_uj4_mxy_bs-d46e75173",},{"title":"JDBC Attributes","shortdesc":"\n               <p class=\"shortdesc\">The JDBC Query Consumer origin generates record header attributes and field         attributes that provide additional information\n                  about each record and field. \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_k2s_3mt_tkb","attributes": {"data-id":"concept_k2s_3mt_tkb",},"menu": {"hasChildren":true,},"tocID":"concept_k2s_3mt_tkb-d46e75690","next":"concept_k2s_3mt_tkb-d46e75690",},{"title":"CDC for Microsoft SQL Server","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_tyd_gbf_5y","attributes": {"data-id":"concept_tyd_gbf_5y",},"menu": {"hasChildren":true,},"tocID":"concept_tyd_gbf_5y-d46e76366","next":"concept_tyd_gbf_5y-d46e76366",},{"title":"Event Generation","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#concept_o1c_kwr_kz","attributes": {"data-id":"concept_o1c_kwr_kz",},"menu": {"hasChildren":true,},"tocID":"concept_o1c_kwr_kz-d46e76978","next":"concept_o1c_kwr_kz-d46e76978",},{"title":"Configuring a JDBC Query Consumer","href":"datacollector\/UserGuide\/Origins\/JDBCConsumer.html#task_ryz_tkr_bs","attributes": {"data-id":"task_ryz_tkr_bs",},"menu": {"hasChildren":false,},"tocID":"task_ryz_tkr_bs-d46e77436","topics":[]}]});